import styled from 'styled-components';

export const Container = styled.section`
  background: rgb(255, 255, 255);
  border-radius: 4%;
  margin: 5rem 8% 2rem;
  padding: 1.4rem;
  text-align: center;
  justify-content: center;
  div{
    margin: 0;
    padding: 0;
    min-width:320px;
    height:630px;   
  }
`;
